import React, { useEffect, useState } from "react";
import { Button, StyleSheet, Text, View ,FlatList } from "react-native";
import vjezbeServer from '../src/services/vjezbe'

const Kategorije = (props) => {

const [vjezbe, postaviVjezbe]=useState([])

  useEffect( ()=>{
    console.log("effect hook");
    vjezbeServer.dohvatiSve().then((response) => {
      console.log("Podaci ucitani");
      postaviVjezbe(response.data)
    })
  })
  let kategorije = [...new Set(vjezbe.map(item => item.kategorija))];
  const obj = Object.assign({}, kategorije);
  
  
  const renderGrid = (obj) => {
    return (
      <View style={stil.gridElement}>
        <Text>{obj.item}</Text>
      </View>
    )
  }
  return (
    <View style={stil.ekran}>
      <Text>Ekran za Kategorije</Text>
      <Button title= 'Moje kategorije'
      onPress={()=> { 
        props.navigation.navigate('JednaKategorija') }}/>
      <FlatList data={obj} numColumns={2} renderItem={renderGrid} />
      <Text> {kategorije}</Text>
     
      <Button title= 'Odjava' 
  onPress={()=> { props.navigation.navigate('Login') }}/>
    </View>
  );
};
const stil = StyleSheet.create({
  gridElement: {
    flex: 1,
    margin: 15,
    height: 150
  },
  container: {
    flex: 1,
    justifyContent: 'center',
    backgroundColor: '#ecf0f1',
  },
  video: {
    alignSelf: 'center',
    width: 320,
    height: 200,
  },
  ekran: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
  },
});

export default Kategorije;
